import React,{useEffect} from 'react';
import CountryList from '../../components/countries/CountryList';
import CountryForm from '../../components/countries/CountryForm';



const CountryIndex = () => {

  const getCountries = async () => {
    const data = await fetch(`http://127.0.0.1:8000/api/countries/list`);
    const countries = await data.json();
    return countries; 
  }

  useEffect(() => {
    getCountries();
  },[]);

  return (
    <div className="country-index-container">
      <div className="row">
        <CountryList getCountries={getCountries} />
      </div>
      <div className="row">
        <CountryForm />
      </div>
    </div>
  );
};

export default CountryIndex;
